import React from "react";
import "./style.css";

function SearchForm({ search, handleInputChange, handleFormSubmit }) {
  return (
    <form>
      <div className="wrap">
        <input
          onChange={handleInputChange}
          value={search}
          name="search"
          type="text"
          className="searchTerm"
          placeholder="Search news headlines"
          id="search"
        />
        <button onClick={handleFormSubmit} className="searchButton">
        <i class="fa fa-search"></i>
        </button>
      </div>
    </form>
  );
}

export default SearchForm;
